import React from "react";
import { BrowserRouter } from 'react-router-dom';
import { Outlet } from "react-router-dom";

import Header from './components/Header';
import Footer from './components/Footer';

import Routes from './Routes';

import './App.css';

function App() {

  return (

    <BrowserRouter>

      <Header />

      <Routes />

      <Outlet />

      <Footer />

    </BrowserRouter>

  );

}

export default App;
